import "./App.css";
import Search from "./components/Search" ;
import Add from "./components/Add";
import List from "./components/List";


function App() {
  return (
    <main>
      <header>
        <div className="title"> 
          <h2> VIDEO LIST</h2>
        </div>
        <div className="search">
          <Search></Search>
        </div>
      </header>
      <section className="content">
        <div className="add">
          <Add></Add>
        </div>
        <div className="list">
          <List> </List>
        </div>
      </section>
    </main>
  );
}

export default App;
